import React, { useState } from 'react';
import '../styles/index.scss';
import { RegisterPageType } from './RegisterPageType';


const RegisterPage = () => {

  const [name, setName] = useState('');
  const [surname, setSurname] = useState('');
  const [birthday, setBirthday] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  const handleFocus = (event: React.FocusEvent<HTMLInputElement>, newPlaceholder) => {
    event.currentTarget.placeholder = newPlaceholder;
  };

  const EmailHandleBlur = (event: React.FocusEvent<HTMLInputElement>) => {
    event.currentTarget.placeholder = 'email@gmail.com';
  };
  const PasswordHandleFocus = (event: React.FocusEvent<HTMLInputElement>) => {
    event.currentTarget.placeholder = '';
  };

  const PasswordHandleBlur = (event: React.FocusEvent<HTMLInputElement>) => {
    event.currentTarget.placeholder = 'hasło';
  };

  return (
    <form>
      <h1>Register</h1>

      <input 
        type='email' 
        className='register-input-form' 
        placeholder="email@gmail.com" 
        onFocus={(event) => handleFocus(event, '')}
        onBlur={EmailHandleBlur}
        required
      />

      <input 
        type='password' 
        className='register-input-form' 
        placeholder="hasło" 
        onFocus={PasswordHandleFocus}
        onBlur={PasswordHandleBlur}
        required
      />

      <button type='submit'>Utwórz Konto</button>

    </form>
  );
}

export default RegisterPage;
